INSERT INTO `ao_index` VALUES (1,'o-maidens-in-your-savage-season_subbed','O Maidens in Your Savage Season','Araburu Kisetsu no Otome domo yo',12,'https://animemoon.net/kitsuImages/cover_42025.jpg','Comedy, Drama, Romance, School, Shounen','When the girls in the literature club ask themselves, What do you want to do before you die? one of them gives a most surprising response. Now they&#39;re all preoccupied (for better or for worse) by their friend&#39;s unexpected answer! Soon each of these very different young women find themselves propelled along the uncertain road to adulthood, their emotional journeys taking them down paths as surprising as their friend&#39;s unconventional wish. Poignant, painful and awkward in turns, O Maidens in Your Savage Season chronicles with humor and with grace the universal rites of passage so endemic to growing up.','subbed','Lay-duce','Finished Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42025.jpg','Jul 06, 2019',0),(3,'arifureta-shokugyou-de-sekai-saikyou','Arifureta: From Commonplace to World&#39;s Strongest','Arifureta',12,'https://animemoon.net/kitsuImages/cover_14043.jpg','Fantasy, Action, Adventure','Hajime Nagumo and his high school class are suddenly summoned to a fantastical land as heroes. But while most of his classmates have powerful stats and abilities, Hajime does not. Underappreciated and unprepared, he tumbles into the depths of a monster-infested dungeon where voracity and sacrifice are his only options. To thrive in this savage world, hell have no choice but to welcome the abyss.','subbed','White Fox','Finished Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/arifureta.jpg','Jul 08, 2019',0),(4,'arifureta-shokugyou-de-sekai-saikyou_dubbed','Arifureta: From Commonplace to World&#39;s Strongest','Arifureta',8,'https://animemoon.net/kitsuImages/cover_14043.jpg','Fantasy, Action, Adventure','Hajime Nagumo and his high school class are suddenly summoned to a fantastical land as heroes. But while most of his classmates have powerful stats and abilities, Hajime does not. Underappreciated and unprepared, he tumbles into the depths of a monster-infested dungeon where voracity and sacrifice are his only options. To thrive in this savage world, hell have no choice but to welcome the abyss.','dubbed','White Fox','Finished Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/arifureta.jpg','Jul 08, 2019',0),(5,'arslan-senki-tv','The Heroic Legend of Arslan','Arslan Senki',25,'https://animemoon.net/kitsuImages/cover_9972.jpg','Historical, Fantasy, Drama, Action, Adventure','The year is 320. Under the rule of the belligerent king Andragoras III, the prosperous kingdom of Pars is at war with the neighboring empire, Lusitania. Though different from his father in many aspects, the kind young prince Arslan sets out to prove his valor on the battlefield for the very first time. However, when the king is betrayed by one of his most trusted officials, the Parsian army is decimated and the capital city of Ecbatana is sieged. With the army in shambles and the Lusitanians out for his head, Arslan is forced to go on the run. With a respected general by his side, the loyal Daryun, Arslan soon sets off on a journey in search of allies that will help him take back his home.\r\nHowever, the enemies that the prince faces are far from limited to just those occupying his kingdom. Armies of other kingdoms stand ready to conquer Ecbatana. Moreover, the mastermind behind Lusitania&#39;s victory, an enigmatic man hiding behind a silver mask, poses a dangerous threat to Arslan and his company as he possesses a secret that could jeopardize Arslan&#39;s right to succession.\r\nWith the odds stacked against him, Arslan must find the strength and courage to overcome these obstacles and allies who will help him fight in the journey that will help prepare him for the day he becomes king.','subbed','LidenFilms','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_9972.jpg','Apr 05, 2015',0),(6,'arslan-senki-tv_dubbed','The Heroic Legend of Arslan','Arslan Senki',25,'https://animemoon.net/kitsuImages/cover_9972.jpg','Historical, Fantasy, Drama, Action, Adventure','The year is 320. Under the rule of the belligerent king Andragoras III, the prosperous kingdom of Pars is at war with the neighboring empire, Lusitania. Though different from his father in many aspects, the kind young prince Arslan sets out to prove his valor on the battlefield for the very first time. However, when the king is betrayed by one of his most trusted officials, the Parsian army is decimated and the capital city of Ecbatana is sieged. With the army in shambles and the Lusitanians out for his head, Arslan is forced to go on the run. With a respected general by his side, the loyal Daryun, Arslan soon sets off on a journey in search of allies that will help him take back his home.\r\nHowever, the enemies that the prince faces are far from limited to just those occupying his kingdom. Armies of other kingdoms stand ready to conquer Ecbatana. Moreover, the mastermind behind Lusitania&#39;s victory, an enigmatic man hiding behind a silver mask, poses a dangerous threat to Arslan and his company as he possesses a secret that could jeopardize Arslan&#39;s right to succession.\r\nWith the odds stacked against him, Arslan must find the strength and courage to overcome these obstacles and allies who will help him fight in the journey that will help prepare him for the day he becomes king.','dubbed','LidenFilms','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_9972.jpg','Apr 05, 2015',0),(7,'arslan-senki-tv-fuujin-ranbu','The Heroic Legend of Arslan: Dust Storm Dance','Arslan Senki Fuujin Ranbu',8,'https://animemoon.net/kitsuImages/cover_11477.jpg','Historical, Fantasy, Drama, Action, Adventure','Continuing on his quest to retake Ecbatana, Prince Arslan and his company march toward the city. But upon receiving news that the neighboring Kingdom of Turan is launching an assault on the Parsian stronghold at Peshawar Citadel, the prince is forced to turn back in order to defend the fortress. Amid holding off the invading forces, the Parsian army is met by an unexpected visitor.\r\nAs Arslan returns to Peshawar, Prince Hermes takes a slight detour from his clash against his cousin to search for the legendary sword Rukhnabad, which would grant him the right to rule and take back what he believes is rightfully his. However, after unearthing the lost artifact, the blade is stolen by the Temple Knights of Lusitania, prompting the masked warrior to give chase. Meanwhile in Ecbatana, the captive King Andragoras III finds an opportunity to strike and begins to make his move.\r\nAs the separate sides of the Parsian royal conflict clash, Arslan&#39;s right to the throne falls under attack. But no matter the obstacles in their way, the young prince and his loyal band of warriors charge forward to restore Pars to its former glory.','subbed','LidenFilms','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_11477.jpg','Jul 03, 2016',0),(8,'arslan-senki-tv-fuujin-ranbu_dubbed','The Heroic Legend of Arslan: Dust Storm Dance','Arslan Senki Fuujin Ranbu',8,'https://animemoon.net/kitsuImages/cover_11477.jpg','Historical, Fantasy, Drama, Action, Adventure','Continuing on his quest to retake Ecbatana, Prince Arslan and his company march toward the city. But upon receiving news that the neighboring Kingdom of Turan is launching an assault on the Parsian stronghold at Peshawar Citadel, the prince is forced to turn back in order to defend the fortress. Amid holding off the invading forces, the Parsian army is met by an unexpected visitor.\r\nAs Arslan returns to Peshawar, Prince Hermes takes a slight detour from his clash against his cousin to search for the legendary sword Rukhnabad, which would grant him the right to rule and take back what he believes is