ns&#39; armed forces. He is able to escape, however, thanks to the timely appearance of a mysterious girl named C.C., who bestows upon him Geass, the &#34;Power of Kings.&#34; Realizing the vast potential of his newfound &#34;power of absolute obedience,&#34; Lelouch embarks upon a perilous journey as the masked vigilante known as Zero, leading a merciless onslaught against Britannia in order to get revenge once and for all.','subbed','Sunrise','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_1415.jpg','Oct 06, 2006',0),(15,'code-geass-lelouch-of-the-rebellion_dubbed','Code Geass: Lelouch of the Rebellion','Code Geass: Hangyaku no Lelouch',0,'https://animemoon.net/kitsuImages/cover_1415.png','Sci-Fi, Super Power, School, Military, Mecha Drama, Action, Political','In the year 2010, the Holy Empire of Britannia is establishing itself as a dominant military nation, starting with the conquest of Japan. Renamed to Area 11 after its swift defeat, Japan has seen significant resistance against these tyrants in an attempt to regain independence.\r\n\r\nLelouch Lamperouge, exiled prince of Britannia, unfortunately finds himself caught in a crossfire between the two nations&#39; armed forces. He is able to escape, however, thanks to the timely appearance of a mysterious girl named C.C., who bestows upon him Geass, the &#34;Power of Kings.&#34; Realizing the vast potential of his newfound &#34;power of absolute obedience,&#34; Lelouch embarks upon a perilous journey as the masked vigilante known as Zero, leading a merciless onslaught against Britannia in order to get revenge once and for all.','dubbed','Sunrise','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_1415.jpg','Oct 06, 2006',0),(16,'code-geass-lelouch-of-the-rebellion-r2','Code Geass: Lelouch of the Rebellion R2','Code Geass: Hangyaku no Lelouch R2',25,'https://animemoon.net/kitsuImages/cover_2634.png','Sci-Fi, Super Power, Military, Mecha Drama, Action, Political','One year has passed since the Black Rebellion, a failed uprising against the Holy Britannian Empire led by the masked vigilante Zero, who is now missing. At a loss without their revolutionary leader, Area 11&#39;s resistance groupthe Black Knightsfind themselves too powerless to combat the brutality inflicted upon the Elevens by Britannia, which has increased significantly in order to crush any hope of a future revolt. \r\n\r\nLelouch Lamperouge, having lost all memory of his double life, is living peacefully alongside his friends as a high school student at Ashford Academy. His former partner C.C., unable to accept this turn of events, takes it upon herself to remind him of his past purpose, hoping that the mastermind Zero will rise once again to finish what he started, in this thrilling conclusion to the series.','subbed','Sunrise','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_2634.jpg','Apr 06, 2008',0),(17,'code-geass-lelouch-of-the-rebellion-r2_dubbed','Code Geass: Lelouch of the Rebellion R2','Code Geass: Hangyaku no Lelouch R2',0,'https://animemoon.net/kitsuImages/cover_2634.png','Sci-Fi, Super Power, Military, Mecha Drama, Action, Political','One year has passed since the Black Rebellion, a failed uprising against the Holy Britannian Empire led by the masked vigilante Zero, who is now missing. At a loss without their revolutionary leader, Area 11&#39;s resistance groupthe Black Knightsfind themselves too powerless to combat the brutality inflicted upon the Elevens by Britannia, which has increased significantly in order to crush any hope of a future revolt. \r\n\r\nLelouch Lamperouge, having lost all memory of his double life, is living peacefully alongside his friends as a high school student at Ashford Academy. His former partner C.C., unable to accept this turn of events, takes it upon herself to remind him of his past purpose, hoping that the mastermind Zero will rise once again to finish what he started, in this thrilling conclusion to the series.','dubbed','Sunrise','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_2634.jpg','Apr 06, 2008',0),(18,'cop-craft','Cop Craft','Cop Craft',11,'https://animemoon.net/kitsuImages/cover_42174.jpg','Action, Fantasy, Magic, Police, Sci-Fi','15 years ago, a hyper-dimensional rift appeared above the Pacific Ocean linking Earth with a magical world. San-Teresa City became a melting pot of cultures and species, but despite peace on the surface, theres always an underbelly. Thats where Detective Kei Matoba and knight Tirana come inpartners with different perceptions of life and law, working together to keep the city safe.','subbed','Millepensee','Finished Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42174.jpg','Jul 09, 2019',0),(19,'cop-craft_dubbed','Cop Craft','Cop Craft',9,'https://animemoon.net/kitsuImages/cover_42174.jpg','Action, Fantasy, Magic, Police, Sci-Fi','15 years ago, a hyper-dimensional rift appeared above the Pacific Ocean linking Earth with a magical world. San-Teresa City became a melting pot of cultures and species, but despite peace on the surface, theres always an underbelly. Thats where Detective Kei Matoba and knight Tirana come inpartners with different perceptions of life and law, working together to keep the city safe.','dubbed','Millepensee','Finished Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42174.jpg','Jul 09, 2019',0),(20,'darker-than-black','Darker than Black','Darker than Black',26,'https://cdn.myanimelist.net/images/anime/5/19570.jpg','Sci-Fi, Mystery, Super Power, Action','It has been 10 years since Heaven&#39;s Gate appeared in South America and Hell&#39;s Gate appeared in Japan, veiling the once familiar night sky with an oppressive skyscape. Their purposes unknown, these Gates are spaces in which the very laws of physics are ignored. With the appearance of the Gates emerged Contractors, who, in exchange for their humanity, are granted supernatural abilities.\r\nIn the Japanese city surrounding Hells Gate, Section 4 Chief Misaki Kirihara finds herself at odds with an infamous Contractor codenamed Hei. Called &#34;Black Reaper&#34; in the underground world, Hei, like his associates, undertakes missions for the mysterious and ruthless Syndicate while slowly peeling back the dark layers covering a nefarious plot that threatens the very existence of Contractors.\r\nFrom the mind of Tensai Okamura comes a sci-fi thriller taking the form of a subtle expos on a war in which political positions and justice have no swaya war waged exclusively in the shadows.','subbed','Bones','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_1824.jpg','Apr 06, 2007',0),(21,'darker-than-black_dubbed','Darker than Black','Darker than Black',0,'https://cdn.myanimelist.net/images/anime/5/19570.jpg','Sci-Fi, Mystery, Super Power, Action','It has been 10 years since Heaven&#39;s Gate appeared in South America and Hell&#39;s Gate appeared in Japan, veiling the once familiar night sky with an oppressive skyscape. Their purposes unknown, these Gates are spaces in which the very laws of physics are ignored. With the appearance of the Gates emerged Contractors, who, in exchange for their humanity, are granted supernatural abilities.\r\nIn the Japanese city surrounding Hells Gate, Section 4 Chief Misaki Kirihara finds herself at odds with an infamous Contractor codenamed Hei. Called &#34;Black Reaper&#34; in the underground world, Hei, like his associates, undertakes missions for the mysterious and ruthless Syndicate while slowly peeling back the dark layers covering a nefarious plot that threatens the very existence of Contractors.\r\nFrom the mind of Tensai Okamura comes a sci-fi thriller taking the form of a subtle expos on a war in which political positions and justice have no swaya war waged exclusively in the shadows.','dubbed','Bones','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_1824.jpg','Apr 06, 2007',0),(22,'darker-than-black-ryuusei-no-gemini','Darker than Black: Gemini of the Meteor','Darker than Black: Ryuusei no Gemini',12,'https://animemoon.net/kitsuImages/cover_4617.jpg','Sci-Fi, Mystery, Super Power, Action','One night, as meteors streak across the star-studded sky, Shion Pavlichenko becomes a Contractor. Despite her brother&#39;s transformation, Shion&#39;s twin sister Suou continues to live a fairly ordinary life, attending middle school with her friends and getting caught up in the awkwardness of growing up. However, everything changes when her home is invaded by a masked man cloaked in black, destroying any sense of normality she once had. Revealed to possess latent Contractor abilities of her own, Suou is caught between family, friends, and her own sense of purpose as she ventures into the ruthless world of cutthroats and espionage that Contractors call home.\r\nMeanwhile in Tokyo, investigation surrounding Hell&#39;s Gate&#39;s sudden collapse is underway, and prophetic signs of doom point in the direction of a silver-haired doll.','subbed','Bones','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_4617.jpg','Oct 09, 2009',0),(23,'darker-than-black-ryuusei-no-gemini_dubbed','Darker than Black: Gemini of the Meteor','Darker than Black: Ryuusei no Gemini',0,'https://animemoon.net/kitsuImages/cover_4617.jpg','Sci-Fi, Mystery, Super Power, Action','One night, as meteors streak across the star-studded sky, Shion Pavlichenko becomes a Contractor. Despite her brother&#39;s transformation, Shion&#39;s twin sister Suou continues to live a fairly ordinary life, attending middle school with her friends and getting caught up in the awkwardness of growing up. However, everything changes when her home is invaded by a masked man cloaked in black, destroying any sense of normality she once had. Revealed to possess latent Contractor abilities of her