t where the full moon was shining brightly, she happens to meet another girl with the character for &#34;moon&#34; in her name named Shingetsu Ernesta Fukami. That was also when she encountered the mechanical dolls called &#34;ARMANOX.','subbed','Unknown','Finished Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42159.jpg','Jul 06, 2019',0),(39,'grancrest-senki','Record of Grancrest War','Grancrest Senki',24,'https://animemoon.net/kitsuImages/cover_12705.jpg','Fantasy, Drama, Romance, Action, Adventure','On a continent ruled by chaos, the Lords have the power of a holy seal that can calm the chaos and protect the people. However, before anyone realizes it, the rulers cast aside their creed of purifying the chaos, and instead start to fight each other for each other&#39;s holy seals to gain dominion over one another. Shiruuka, an isolated mage who scorns the Lords for abandoning their creed, and a wandering knight named Theo, who is on a journey to train to one day liberate his hometown, make an everlasting oath to work together to reform this continent dominated by wars and chaos.','subbed','A-1 Pictures','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_12705.jpg','Jan 06, 2018',0),(40,'grancrest-senki_dubbed','Record of Grancrest War','Grancrest Senki',23,'https://animemoon.net/kitsuImages/cover_12705.jpg','Fantasy, Drama, Romance, Action, Adventure','On a continent ruled by chaos, the Lords have the power of a holy seal that can calm the chaos and protect the people. However, before anyone realizes it, the rulers cast aside their creed of purifying the chaos, and instead start to fight each other for each other&#39;s holy seals to gain dominion over one another. Shiruuka, an isolated mage who scorns the Lords for abandoning their creed, and a wandering knight named Theo, who is on a journey to train to one day liberate his hometown, make an everlasting oath to work together to reform this continent dominated by wars and chaos.','dubbed','A-1 Pictures','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_12705.jpg','Jan 06, 2018',0),(41,'guilty-crown','Guilty Crown','',22,'https://animemoon.net/kitsuImages/cover_6349.jpg','Sci-Fi, Super Power, Drama, Romance, Action','Japan, 2039. Ten years after the outbreak of the &#34;Apocalypse Virus,&#34; an event solemnly regarded as &#34;Lost Christmas,&#34; the once proud nation has fallen under the rule of the GHQ, an independent military force dedicated to restoring order. Funeral Parlor, a guerilla group led by the infamous Gai Tsutsugami, act as freedom fighters, offering the only resistance to GHQ&#39;s cruel despotism.\r\nInori Yuzuriha, a key member of Funeral Parlor, runs into the weak and unsociable Shuu Ouma during a crucial operation, which results in him obtaining the &#34;Power of Kings&#34;an ability which allows the wielder to draw out the manifestations of an individual&#39;s personality, or &#34;voids.&#34; Now an unwilling participant in the struggle against GHQ, Shuu must learn to control his newfound power if he is to help take back Japan once and for all.Guilty Crown follows the action-packed story of a young high school student who is dragged into a war, possessing an ability that will help him uncover the secrets of the GHQ, Funeral Parlor, and Lost Christmas. However, he will soon learn that the truth comes at a far greater price than he could have ever imagined.','subbed','Production I.G','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_6349.jpg','Oct 14, 2011',0),(42,'guilty-crown_dubbed','Guilty Crown','',22,'https://animemoon.net/kitsuImages/cover_6349.jpg','Sci-Fi, Super Power, Drama, Romance, Action','Japan, 2039. Ten years after the outbreak of the &#34;Apocalypse Virus,&#34; an event solemnly regarded as &#34;Lost Christmas,&#34; the once proud nation has fallen under the rule of the GHQ, an independent military force dedicated to restoring orde