h. One day on a job deep in the forest, he comes across a little devil girl who&#39;s almost wasted away. Unable to just leave her there to die, Dale takes her home and becomes her adoptive father.  Devil or not, Latina is beyond adorable, and the adventurer soon finds himself head over heels with being a parent.  But why was she out in the forest to begin with, and why does she carry the mark of a criminal?','subbed','Maho Films','Finished Airing','PG-13 - Teens 13 or older','https://animemoon.net/img/anime/newicons/no_wp.jpg','Jul 4, 2019',0),(68,'vinland-saga','Vinland Saga','Vinland Saga',18,'https://animemoon.net/kitsuImages/cover_41084.jpg','Historical, Drama, Action, Adventure','As a child, Thorfinn sat at the feet of the great Leif Ericson and thrilled to wild tales of a land far to the west. But his youthful fantasies were shattered by a mercenary raid. Raised by the Vikings who murdered his family, Thorfinn became a terrifying warrior, forever seeking to kill the band&#39;s leader, Askeladd, and avenge his father. Sustaining Throfinn through his ordeal are his pride in his family and his dreams of a fertile westward land, a land without war or slavery  the land Leif called Vinland.','subbed','Wit ','Currently Airing','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_41084.jpg','Jul 08, 2019',0),(69,'violet-evergarden','Violet Evergarden','Violet Evergarden',12,'https://animemoon.net/kitsuImages/cover_12230.jpg','Fantasy, Slice of Life, Drama','There are words Violet heard on the battlefield, which she cannot forget. These words were given to her by someone she holds dear, more than anyone else. She does not yet know their meaning.\r\nA certain point in time, in the continent of Telesis. The great war which divided the continent into North and South has ended after four years, and the people are welcoming a new generation.\r\n\r\nViolet Evergarden, a young girl formerly known as the weapon, has left the battlefield to start a new life at CH 