 is targeting criminals and, consequently, try to apprehend the culprit. To do this, the Japanese investigators count on the assistance of the best detective in the world: a young and eccentric man known only by the name of L.','dubbed','Madhouse','Finished','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_1376.jpg','Oct 04, 2006',0),(85,'wolf-children','Wolf Children','',1,'https://animemoon.net/kitsuImages/cover_6711.jpg','Fantasy, Slice of Life, Family','Hana, a hard-working college student, falls in love with a mysterious man who attends one of her classes though he is not an actual student. As it turns out, he is not truly human either. On a full moon night, he transforms, revealing that he is the last werewolf alive. Despite this, Hana&#39;s love remains strong, and the two ultimately decide to start a family.\r\nHana gives birth to two healthy childrenAme, born during rainfall, and Yuki, born during snowfallboth possessing the ability to turn into wolves, a trait inherited from their father. All too soon, however, the sudden death of her lover devastates Hana&#39;s life, leaving her to raise a peculiar family completely on her own. The stress of raising her wild-natured children in a densely populated city, all while keeping their identity a secret, culminates in a decision to move to the countryside, where she hopes Ame and Yuki can live a life free from the judgments of society. Wolf Children is the heartwarming story about the challenges of being a single mother in an unforgiving modern world.','subbed','Chizu','Finished','PG-Children','https://animemoon.net/kitsuImages/banner_6711.jpg','Jul 21, 2012',0),(86,'wolf-children_dubbed','Wolf Children','',1,'https://animemoon.net/kitsuImages/cover_6711.jpg','Fantasy, Slice of Life, Family','Hana, a hard-working college student, falls in love with a mysterious man who attends one of her classes though he is not an actual student. As it turns out, he is not truly human either. On a full moon night