e a lifespan of hundreds of years and maintain their teenage appearances for life, but when the peace of this town is shattered by those who want the secret to their longevity for themselves, a young girl named Maquia is forced to escape. Wandering the land alone, upon finding an orphaned baby she chooses to raise him, but as this boy grows up so the difference in their lifespans is thrown into ever-sharper relief.','dubbed','P.A. Works','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_13612.jpg','Feb 24, 2018',0),(89,'howl-s-moving-castle','Howl&#39;s Moving Castle','',1,'https://animemoon.net/kitsuImages/cover_395.jpg','Fantasy, Drama Romance Adventure','That jumbled piece of architecture, that cacophony of hissing steam and creaking joints, with smoke billowing from it as it moves on its own... That castle is home to the magnificent wizard Howl, infamous for both his magical prowess and for being a womanizeror so the rumor goes in Sophie Hatter&#39;s small town. Sophie, as the plain daughter of a hatmaker, does not expect much from her future and is content with working hard in the shop. \r\nHowever, Sophie&#39;s simple life takes a turn for the exciting when she is ensnared in a disturbing situation, and the mysterious wizard appears to rescue her. Unfortunately, this encounter, brief as it may be, spurs the vain and vengeful Witch of the Wastein a fit of jealousy caused by a past discord with Howlto put a curse on the maiden, turning her into an old woman.\r\nIn an endeavor to return to normal, Sophie must accompany Howl and a myriad of eccentric companionsranging from a powerful fire demon to a hopping scarecrowin his living castle, on a dangerous adventure as a raging war tears their kingdom apart.','subbed','Ghibli','Finished','G-All Ages','https://animemoon.net/kitsuImages/banner_395.png','Nov 20, 2004',0),(90,'howl-s-moving-castle_dubbed','Howl&#39;s Moving Castle','',1,'https://animemoon.net/kitsuImages/cover_395.jpg','Fantasy, 