en the kindest of people cruel yet their youthful hope shines brightly in the face of unrelenting hardship, preventing the siblings from swiftly succumbing to an inevitable fate.','subbed','Ghibli','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_534.jpg','Apr 16, 1988',0),(92,'grave-of-the-fireflies_dubbed','Grave of the Fireflies','',1,'https://animemoon.net/kitsuImages/cover_534.jpg','Historical, Drama','As World War II reaches its conclusion in 1945, Japan faces widespread destruction in the form of American bombings, devastating city after city. Hotaru no Haka, also known as Grave of the Fireflies, is the story of Seita and his sister Setsuko, two Japanese children whose lives are ravaged by the brutal war. They have lost their mother, their home, and the prospect of a bright futureall tragic consequences of a single air raid.\r\nNow orphaned and homeless, Seita and Setsuko have no choice but to drift across the countryside,  beset by starvation and disease. Met with the apathy of adults along the way, they find that desperate circumstances can turn even the kindest of people cruel yet their youthful hope shines brightly in the face of unrelenting hardship, preventing the siblings from swiftly succumbing to an inevitable fate.','dubbed','Ghibli','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_534.jpg','Apr 16, 1988',0),(93,'kizumonogatari-part-1-tekketsu-hen','Kizumonogatari Part 1: Tekketsu','',1,'https://animemoon.net/kitsuImages/cover_5649.jpg','Mystery, Supernatural, Vampire','First season of the Monogatari Series, part 2/6. Contains the arc Koyomi Vamp from the Kizumonogatari light novel. \r\n\r\nMarch 25thjust another day during spring break.\r\nKoyomi Araragi, a second year high school student at Naoetsu High School, befriends Tsubasa Hanekawa, the top honors student at his school. Hanekawa mentions a rumor about a &#34;blonde vampire&#34; that has been sighted around their town recently. Araragi, who is usually anti-social, takes a liking to her down-to-earth personality. \r\n\r\nThat night, Araragi encounters the rumored vampire: she is Kiss-shot Acerola-orion Heart-under-blade, also known as the &#34;iron-blooded, hot-blooded, cold-blooded King of Apparitions.&#34; The stunningly beautiful vampire cries out for Koyomi to save her as she lies in a pool of her own blood, all four of her limbs cut off. Kiss-shot asks Araragi to give her his blood, and when he does, the next moment he awakes, Araragi finds himself reborn as her vampire kin. As Araragi struggles to accept his existence, Kiss-shot whispers, &#34;Welcome to the world of darkness...','subbed','Shaft','Finished','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_5649.jpg','Jan 08, 2016',0),(94,'kizumonogatari-part-2-nekketsu-hen','Kizumonogatari Part 2: Nekketsu','',1,'https://animemoon.net/kitsuImages/cover_11406.jpg','Mystery, Supernatural, Vampire, Action','In the spring of his second year of high school, Koyomi Araragi met the beautiful vampire Kiss-shot Acerola-orion Heart-under-blade. Koyomi saved Kiss-shot, who was on the verge of death with all four of her limbs cut off, but only at the expense of becoming her minion and a vampire.\r\n\r\n&#34;In order to go back to being a human again, you must take back all of Kiss-shot&#39;s limbs.&#34; After receiving advice from Meme Oshino, an expert in the supernatural, Koyomi prepares to go into battle.\r\n\r\nAwaiting him are three powerful vampire huntersDramaturgy, a giant vampire hunter who is a vampire himself. Episode, a half-vampire who wields an enormous cross, and Guillotinecutter, a quiet man who specializes in killing vampires.','subbed','Shaft','Finished','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_11406.jpg','Aug 19, 2016',0),(95,'kizumonogatari-part-3-reiketsu-hen','Kizumonogatari Part 3: Reiketsu','',1,'https://animemoon.net/kitsuImages/cover_11407.jpg','Mystery, Supernatural, Vampire, Action','With help from Meme Oshino, the apparition specialist, Koyomi defeats the three powerful vampire hunters: Dramaturgy, Episode and Guillotinecutter.\r\n\r\nKoyomi takes back all the limbs of Kiss-Shot-Acerola-Orion-Heart-Underblade in order to become a human again.\r\n\r\nBut, when he returns to Kiss-Shot, she reveals to him the cold truth of what it means to be a vampirea creature of the night. Unable to take back what he has done, Koyomi feels nothing but regret and can only deny his dreadful fate.','subbed','Shaft','Finished','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_11407.jpg','Jan 06, 2017',0),(96,'spirited-away','Spirited Away','',1,'https://animemoon.net/kitsuImages/cover_176.jpg','Supernatural, Drama, Adventure','Stubborn, spoiled, and nave, 10-year-old Chihiro Ogino is less than pleased when she and her parents discover an abandoned amusement park on the way to their new house. Cautiously venturing inside, she realizes that there is more to this place than meets the eye, as strange things begin to happen once dusk falls. Ghostly apparitions and food that turns her parents into pigs are just the startChihiro has unwittingly crossed over into the spirit world. Now trapped, she must summon the courage to live and work amongst spirits, with the help of the enigmatic Haku and the cast of unique characters she meets along the way.\r\nVivid and intriguing, Sen to Chihiro no Kamikakushi tells the story of Chihiro&#39;s journey through an unfamiliar world as she strives to save her parents and return home.','subbed','Ghibli','Finished','G-All Ages','https://animemoon.net/kitsuImages/banner_176.jpg','Jul 20, 2001',0),(97,'spirited-away_dubbed','Spirited Away','',1,'https://animemoon.net/kitsuImages/cover_176.jpg','Supernatural, Drama, Adventure','Stubborn, spoiled, and nave, 10-year-old Chihiro Ogino is less than pleased when she and her parents discover an abandoned amusement park on the way to their new house. Cautiously venturing inside, she realizes that there is more to this place than meets the eye, as strange things begin to happen once dusk falls. Ghostly apparitions and food that turns her parents into pigs are just the startChihiro has unwittingly crossed over into the spirit world. Now trapped, she must summon the courage to live and work amongst spirits, with the help of the enigmatic Haku and the cast of unique characters she meets along the way.\r\nVivid and intriguing, Sen to Chihiro no Kamikakushi tells the story of Chihiro&#39;s journey through an unfamiliar world as she strives to save her parents and return home.','dubbed','Ghibli','Finished','G-All Ages','https://animemoon.net/kitsuImages/banner_176.jpg','Jul 20, 2001',0),(98,'goblin-slayer','Goblin Slayer','',12,'https://animemoon.net/kitsuImages/cover_40597.jpg','Action, Adventure, Fantas','&#34;I&#39;m not saving the world. I just kill goblins.&#34; Rumor has it that, in a certain guild in the middle of nowhere, there is an extraordinary man who has climbed all the way to the Silver rank just by killing goblins. At the same guild, a priestess who&#39;s just become a new adventurer has formed her first party... and the man who ends up rescuing that party when they get into trouble is none other than the Goblin Slayer.','subbed','White Fox','Finished','R-Violence, Nudity','https://animemoon.net/kitsuImages/banner_40597.jpg','Oct 07, 2018',0),(99,'goblin-slayer_dubbed','Goblin Slayer','',12,'https://animemoon.net/kitsuImages/cover_40597.jpg','Action, Adventure, Fantas','&#34;I&#39;m not saving the world. I just kill goblins.&#34; Rumor has it that, in a certain guild in the middle of nowhere, there is an extraordinary man who has climbed all the way to the Silver rank just by killing goblins. At the same guild, a priestess who&#39;s just become a new adventurer has formed her first party... and the man who ends up rescuing that party when they get into trouble is none other than the Goblin Slayer.','dubbed','White Fox','Finished','R-Violence, Nudity','https://animemoon.net/kitsuImages/banner_40597.jpg','Oct 07, 2018',0),(100,'carole-and-tuesday','Carole & Tuesday','',24,'https://animemoon.net/kitsuImages/cover_41025.jpg','Music','Fifty years have passed since mankind began migrating to the new frontier: Mars. It&#39;s an age where most culture is produced by AI, and people are content to be passive consumers.\r\n\r\nThere&#39;s a girl. Scrapping a living in the metropolis of Alba City, she&#39;s working part time while trying to become a musician. She&#39;s always felt like something is missing. Her name is Carole.\r\n\r\nThere&#39;s a girl. Born to a wealthy family in the provincial town of Herschel City, she dreams of becoming a musician, but nobody around her understands. She feels like the loneliest person in the world. Her name is Tuesday.\r\n\r\nA chance meeting brings them together. They want to sing. They want to make music. Together, they feel like they just might have a chance. The two of them may only create a tiny wave. But that wave will eventually grow into something larger...','subbed','Bones','Finished Airing','null-','https://animemoon.net/kitsuImages/banner_41025.jpg','Apr 11, 2019',0),(101,'kimetsu-no-yaiba','Demon Slayer: Kimetsu no Yaiba','',26,'https://animemoon.net/kitsuImages/cover_41370.jpg','Action, Demons, Historical, Shounen, Supernatural','It is the Taisho Period in Japan. Tanjiro, a kindhearted boy who sells charcoal for a living, finds his family slaughtered by a demon. To make matters worse, his younger sister Nezuko, the sole survivor, has been transformed into a demon herself. Though devastated by this grim reality, Tanjiro resolves to become a demon slayer so that he can turn his sister back into a human, and kill the demon that massacred his family.','subbed','ufotable','Finished Airing','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_41370.jpg','Apr 06, 2019',0),(102,'dororo','Dororo','',24,'https://animemoon.net/kitsuImages/cover_41083.jpg','Supernatural, Action, Adventure','In Japan&#39;s Warring States period, Lord Daigo Kagemitsu makes a pact with 12 demons, exchanging his unborn son for the prosperity of his lands. The child is born malformed and is set adrift in a river, while Kagemitsu&#39;s lands thrive as promised. Years later, young thief Dororo encounters the mysterious &#34;Hyakkimaru&#34;, a boy whose arms are blades and whose visionless eyes seem able to see monsters.','subbed','Mappa','Finished','R-Violence, Profanity','https://animemoon.net/kitsuImages/banner_41083.png','Jan 07, 2019',0),(103,'island-tv','Island','',12,'https://animemoon.net/kitsuImages/cover_11965.jpg','Sci-Fi, Drama','The island of Urashima sits on the ocean far, far away from the mainland. The island is so lush and beautiful that one might mistake it for paradise, but the people there are trapped by a complex past and long-established traditions. Long since abandoned and all but forgotten by the mainland, the people of the island are ready to give up hope. But then, a young man named Setsuna who calls himself a &#34;time traveler&#34; washes up on the island. Setsuna has lost all of his memories except for a certain mission that he must fulfill. On Urashima he meets three girls, Rinne, Karen, and Sara, and begins.','subbed','Feel','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_11965.jpeg','Jul 01, 2018',0),(104,'island-tv_dubbed','Island','',12,'https://animemoon.net/kitsuImages/cover_11965.jpg','Sci-Fi, Drama','The island of Urashima sits on the ocean far, far away from the mainland. The island is so lush and beautiful that one might mistake it for paradise, but the people there are trapped by a complex past and long-established traditions. Long since abandoned and all but forgotten by the mainland, the people of the island are ready to give up hope. But then, a young man named Setsuna who calls himself a &#34;time traveler&#34; washes up on the island. Setsuna has lost all of his memories except for a certain mission that he must fulfill. On Urashima he meets three girls, Rinne, Karen, and Sara, and begins.','dubbed','Feel','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_11965.jpeg','Jul 01, 2018',0),(105,'91-days','91 Days','',11,'https://animemoon.net/kitsuImages/cover_11957.jpg','Historical, Drama, Action, Crime','During Prohibition, the law held no power and the mafia ruled the town. The story takes place in Lawless, a town thriving on black market sales of illicitly brewed liquor. One day, Avilio receives a letter from a mysterious sender, prompting him to return to Lawless for revenge. He then infiltrates the Vanetti family, the ones responsible for his family&#39;s murder, and sets about befriending the don&#39;s son, Nero, to set his vengeance in motion. Killing brings more killing, and revenge spawns more revenge.','subbed','Shuka','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_11957.jpg','Jul 09, 2016',0),(106,'91-days_dubbed','91 Days','',12,'https://animemoon.net/kitsuImages/cover_11957.jpg','Historical, Drama, Action, Crime','During Prohibition, the law held no power and the mafia ruled the town. The story takes place in Lawless, a town thriving on black market sales of illicitly brewed liquor. One day, Avilio receives a letter from a mysterious sender, prompting him to return to Lawless for revenge. He then infiltrates the Vanetti family, the ones responsible for his family&#39;s murder, and sets about befriending the don&#39;s son, Nero, to set his vengeance in motion. Killing brings more killing, and revenge spawns more revenge.','dubbed','Shuka','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_11957.jpg','Jul 09, 2016',0),(107,'kimi-no-na-wa','Your Name.','',1,'https://animemoon.net/kitsuImages/cover_11614.jpg','Supernatural, School, Drama, Romance, Friendship','From director Makoto Shinkai, the innovative mind behind Voices of a Distant 