 within the game using nothing but their own thoughts.\r\nKazuto Kirigaya, nicknamed &#34;Kirito,&#34; is among the lucky few enthusiasts who get their hands on the first shipment of the game. He logs in to find himself, with ten-thousand others, in the scenic and elaborate world of Aincrad, one full of fantastic medieval weapons and gruesome monsters. However, in a cruel turn of events, the players soon realize they cannot log out; the game&#39;s creator has trapped them in his new world until they complete all one hundred levels of the game.\r\nIn order to escape Aincrad, Kirito will now have to interact and cooperate with his fellow players. Some are allies, while others are foes, like Asuna Yuuki, who commands the leading group attempting to escape from the ruthless game. To make matters worse, Sword Art Online is not all fun and games: if they die in Aincrad, they die in real life. Kirito must adapt to his new reality, fight for his survival, and hopefully break free from his virtual hell.','subbed','A-1 Pictures','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_6589.png','Jul 08, 2012',0),(137,'sword-art-online_dubbed','Sword Art Online','',25,'https://animemoon.net/kitsuImages/cover_6589.png','Game, Fantasy, Romance, Action, Adventure','In the year 2022, virtual reality has progressed by leaps and bounds, and a massive online role-playing game called Sword Art Online (SAO) is launched. With the aid of &#34;NerveGear&#34; technology, players can control their avatars within the game using nothing but their own thoughts.\r\nKazuto Kirigaya, nicknamed &#34;Kirito,&#34; is among the lucky few enthusiasts who get their hands on the first shipment of the game. He logs in to find himself, with ten-thousand others, in the scenic and elaborate world of Aincrad, one full of fantastic medieval weapons and gruesome monsters. However, in a cruel turn of events, the players soon realize they cannot log out; the game&#39;s creator has trapped them