e, which immerses players in a fantasy role-playing game with player rankings and rewards.  Following the new craze, Kirito&#39;s friends dive into the game, and despite his reservations about the system, Kirito eventually joins them. While at first it appears to be just fun and games, they soon find out that the game is not all that it seems...','subbed','A-1 Pictures','Finished Airing','R+ - Mild Nudity','https://animemoon.net/img/anime/newicons/682865.jpg','Feb 18, 2017',0),(141,'sword-art-online-movie-ordinal-scale_dubbed','Sword Art Online Movie: Ordinal Scale','',1,'https://animemoon.net/img/anime/newicons/Sword_art_online_movie.jpg','Action, Game, Adventure, Romance, Fantasy','In 2026, four years after the infamous Sword Art Online incident, a revolutionary new form of technology has emerged: the Augma, a device that utilizes an Augmented Reality system. Unlike the Virtual Reality of the NerveGear and the Amusphere, it is perfectly safe and allows players to use it while they are conscious, creating an instant hit on the market. The most popular application for the Augma is the game Ordinal Scale, which immerses players in a fantasy role-playing game with player rankings and rewards.  Following the new craze, Kirito&#39;s friends dive into the game, and despite his reservations about the system, Kirito eventually joins them. While at first it appears to be just fun and games, they soon find out that the game is not all that it seems...','dubbed','A-1 Pictures','Finished Airing','R+ - Mild Nudity','https://animemoon.net/img/anime/newicons/682865.jpg','Feb 18, 2017',0),(142,'sword-art-online-alternative-gun-gale-online','Sword Art Online Alternative: Gun Gale Online','',12,'https://animemoon.net/kitsuImages/cover_13894.png','Sci-Fi, Military, Game, Fantasy, Action','Karen Kohiruimaki always felt out of place in the real world. Due to her extreme height, she found it hard to make friends with other girls her age. Everything changes when she&#39;s introduced to V