t is a name that must never be forgotten...','subbed','A-1 Pictures','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_13893.jpg','Oct 07, 2018',0),(145,'sword-art-online-alicization_dubbed','Sword Art Online: Alicization','',42,'https://animemoon.net/kitsuImages/cover_13893.jpg','Sci-Fi, Game, Fantasy, Action','&#34;Where...am I...?&#34; Before he knows it, Kirito has made a full-dive into an epic, fantasy-like virtual world. With only a murky recollection of what happened right before he logged in, he starts to wander around, searching for clues.\r\n\r\nHe comes upon an enormous, pitch dark tree (the Gigas Cedar), where he encounters a boy. &#34;My name is Eugeo. Nice to meet you, Kirito.&#34; Although he is supposedly a resident of the virtual world  an NPC  the boy shows the same array of emotions as any human being.\r\n\r\nAs Kirito bonds with Eugeo, he continues to search for a way to log out of this world. Meanwhile, he remembers a certain memory deep down within him. He remembers racing through the mountains with Eugeo as a child... A memory that he should not have in the first place.\r\n\r\nAnd in this memory, he sees someone other than Eugeo, a young blond girl. Her name is Alice. And it is a name that must never be forgotten...','dubbed','A-1 Pictures','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_13893.jpg','Oct 07, 2018',0),(146,'manaria-friends','Manaria Friends','',10,'https://animemoon.net/img/anime/newicons/manaria_friends_ico.jpg','Demons, Supernatural, Magic, Fantasy','Mysteria Academy is a prestigious magic school that teaches magic without discrimination to the three factions (men, gods, demons), who usually are engaged in battle with each other. Two of the academy&#39;s students are Anne, a princess and honor student, and Grea, a princess born from a dragon and a human.','subbed','CygamesPictures','Finished Airing','PG-13 - Teens 13 or older','https://animemoon.net/img/anime/newicons/1002818.jpg','Jan 21, 2019',0),(147,'manaria-friends_dubbed','Manaria Friends','',10,'https://animemoon.net/img/anime/newicons/manaria_friends_ico.jpg','Demons, Supernatural, Magic, Fantasy','Mysteria Academy is a prestigious magic school that teaches magic without discrimination to the three factions (men, gods, demons), who usually are engaged in battle with each other. Two of the academy&#39;s students are Anne, a princess and honor student, and Grea, a princess born from a dragon and a human.','dubbed','CygamesPictures','Finished Airing','PG-13 - Teens 13 or older','https://animemoon.net/img/anime/newicons/1002818.jpg','Jan 21, 2019',0),(148,'saga-of-the-evil-tanya-movie','The Saga of Tanya the Evil Movie','Youjo Senki Movie',1,'https://animemoon.net/img/anime/newicons/youjo_senki_movie.jpg','Military, Magic','In 1926, Tanya and her battalion return home from defeating remnants of the Republic\'s army. However, when they arrive they receive word of a massive mobilization near the border with the Russy Federation, so the Empire\'s army must prepare. At the same time, a multinational army under the leadership of the Allied Kingdom moves into the Russy Federation. The enemy of an enemy is a friend, but among the Allied Kingdom army is Mary Sioux, a girl who has sworn to exact justice against the Empire for the death of her father.\r\n','subbed','Nut','Finished Airing','PG-17 - Teens 17 or older','https://animemoon.net/img/anime/newicons/you_senki_wp.jpg','Feb 8, 2019',0),(149,'boruto-naruto-next-gennerations','Boruto: Naruto Next Generations','Boruto',130,'https://animemoon.net/img/anime/newicons/boruto_ico.jpg','Action, Adventure, Martial Arts, Shounen, Super Power','Following the successful end of the Fourth Shinobi World War, Konohagakure has been enjoying a period of peace, prosperity, and extraordinary technological advancement. This is all due to the efforts of the Allied Shinobi Forces and the village\'s Seventh Hokage, Naruto Uzumaki. Now resembling a modern metropolis, Konohagakure has changed, particularly the life of a shinobi. Under the watchful eye of Naruto and his old comrades, a new generation of shinobi has stepped up to learn the ways of the ninja.\r\n\r\nBoruto Uzumaki is often the center of attention as the son of the Seventh Hokage. Despite having inherited Naruto\'s boisterous and stubborn demeanor, Boruto is considered a prodigy and is able to unleash his potential with the help of supportive friends and family. Unfortunately, this has only worsened his arrogance and his desire to surpass Naruto which, along with his father\'s busy lifestyle, has strained their relationship. However, a sinister force brewing within the village may threaten Boruto\'s carefree life.\r\n\r\nNew friends and familiar faces join Boruto as a new story begins in Boruto: Naruto Next Generations.','subbed','Pierrot','Currently Airing','PG-13 - Teens 13 or older','https://animemoon.net/img/anime/newicons/boruto_wp.jpg','Apr 5, 2017',0),(150,'boruto-naruto-next-gennerations_dubbed','Boruto: Naruto Next Generations','Boruto',52,'https://animemoon.net/img/anime/newicons/boruto_ico.jpg','Action, Adventure, Martial Arts, Shounen, Super Power','Following the successful end of the Fourth Shinobi World War, Konohagakure has been enjoying a period of peace, prosperity, and extraordinary technological advancement. This is all due to the efforts of the Allied Shinobi Forces and the village\'s Seventh Hokage, Naruto Uzumaki. Now resembling a modern metropolis, Konohagakure has changed, particularly the life of a shinobi. Under the watchful eye of Naruto and his old comrades, a new generation of shinobi has stepped up to learn the ways of the ninja.\r\n\r\nBoruto Uzumaki is often the center of attention as the son of the Seventh Hokage. Despite having inherited Naruto\'s boisterous and stubborn demeanor, Boruto is considered a prodigy and is able to unleash his potential with the help of supportive friends and family. Unfortunately, this has only worsened his arrogance and his desire to surpass Naruto which, along with his father\'s busy lifestyle, has strained their relationship. However, a sinister force brewing within the village may threaten Boruto\'s carefree life.\r\n\r\nNew friends and familiar faces join Boruto as a new story begins in Boruto: Naruto Next Generations.','dubbed','Pierrot','Currently Airing','PG-13 - Teens 13 or older','https://animemoon.net/img/anime/newicons/boruto_wp.jpg','Apr 5, 2017',0),(151,'seishun-buta-yarou-wa-bunny-girl-senpai-no-yume-wo-minai','Rascal Does Not Dream of Bunny Girl Senpai','Seishun Buta Yarou wa Bunny Girl Senpai no Yume wo Minai',13,'https://animemoon.net/kitsuImages/cover_41056.jpg','Comedy, School, Romance','&#34;Puberty syndrome  Abnormal experiences rumored on the internet to be caused by sensitivity and instability during adolescence. This year, Sakuta Azusagawa, a second-year student at a high school near Enoshima, meets several girls that are experiencing this puberty syndrome. For instance, he meets a wild bunny girl in the library. She turns out to be an actress on hiatus, Mai Sakurajima, who is also his senior at the school. For some reason, no one else can see this enchanting girl.','subbed','CloverWorks','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_41056.jpg','Oct 04, 2018',0),(152,'planetes','Planetes','Planetes',0,'https://animemoon.net/kitsuImages/cover_296.jpg','Sci-Fi, Space, Drama, Romance','In 2075, space travel is no longer just a dream, but an everyday reality for mankind. Advancements in science and technology have led to the colonization of the moon, the commercialization of outer space, and the formation of large space corporations. Ai Tanabe, an upbeat woman whose interests lie in the cosmos, joins Technora Corporation as a member of their Debris Section, a department dedicated to the removal of dangerous space junk between the orbits of the Earth and Moon.\r\nHowever, Ai soon discovers how unappreciated her job is. As the laughingstock of Technora, the Debris Section is severely understaffed, poorly funded, and is forced to use a dilapidated spaceship nicknamed the &#34;Toy Box&#34; for debris retrieval. Undeterred, Ai perseveres and gradually becomes acquainted with the strange personalities that make up the Debris Section&#39;s staff, such as the bumbling but good-natured chief clerk Philippe Myers; the mysterious and tight-lipped temp worker Edelgard Rivera; and the hotheaded and passionate Hachirota Hoshino, who longs for a spaceship to call his own.\r\nWinner of the Seiun Award in 2005, Planetes is an unconventional sci-fi series that portrays the vastness of space as a backdrop for the personal lives of ordinary peoplepeople who may have been born on Earth, but whose hopes and dreams lie amongst the stars.','subbed','Sunrise','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_296.jpg','Oct 04, 2003',0),(153,'planetes_dubbed','Planetes','Planetes',0,'https://animemoon.net/kitsuImages/cover_296.jpg','Sci-Fi, Space, Drama, Romance','In 2075, space travel is no longer just a dream, but an everyday reality for mankind. Advancements in science and technology have led to the colonization of the moon, the commercialization of outer space, and the formation of large space corporations. Ai Tanabe, an upbeat woman whose interests lie in the cosmos, joins Technora Corporation as a member of their Debris Section, a department dedicated to the removal of dangerous space junk between the orbits of the Earth and Moon.\r\nHowever, Ai soon discovers how unappreciated her job is. As the laughingstock of Technora, the Debris Section is severely understaffed, poorly funded, and is forced to use a dilapidated spaceship nicknamed the &#34;Toy Box&#34; for debris retrieval. Undeterred, Ai perseveres and gradually becomes acquainted with the strange personalities that make up the Debris Section&#39;s staff, such as the bumbling but good-natured chief clerk Philippe Myers; the mysterious and tight-lipped temp worker Edelgard Rivera; and the hotheaded and passionate Hachirota Hoshino, who longs for a spaceship to call his own.\r\nWinner of the Seiun Award in 2005, Planetes is an unconventional sci-fi series that portrays the vastness of space as a backdrop for the personal lives of ordinary peoplepeople who may have been born on Earth, but whose hopes and dreams lie amongst the stars.','dubbed','Sunrise','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_296.jpg','Oct 04, 2003',0),(154,'steins-gate','Steins;Gate','Steins;Gate',25,'https://animemoon.net/kitsuImages/cover_5646.jpg','Sci-Fi, Thriller','The self-proclaimed mad scientist Rintarou Okabe rents out a room in a rickety old building in Akihabara, where he indulges himself in his hobby of inventing prospective &#34;future gadgets&#34; with fellow lab members: Mayuri Shiina, his air-headed childhood friend, and Hashida Itaru, a perverted hacker nicknamed &#34;Daru.&#34; The three pass the time by tinkering with their most promising contraption yet, a machine dubbed the &#34;Phone Microwave,&#34; which performs the strange function of morphing bananas into piles of green gel.\r\n\r\nThough miraculous in itself, the phenomenon doesn&#39;t provide anything concrete in Okabe&#39;s search for a scientific breakthrough; that is, until the lab members are spurred into action by a string of mysterious happenings before stumbling upon an unexpected successthe Phone Microwave can send emails to the past, altering the flow of history.\r\n\r\nAdapted from the critically acclaimed visual novel by 5pb. and Nitroplus, Steins;Gate takes Okabe through the depths of scientific theory and practicality. Forced across the diverging threads of past and present, Okabe must shoulder the burdens that come with holding the key to the realm of time.','subbed','White Fox','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_5646.jpg','Apr 06, 2011