Steins;Gate 0','Steins;Gate 0',23,'https://animemoon.net/kitsuImages/cover_10788.jpg','Sci-Fi, Thriller','A divergent continuation of the original Steins;Gate ending, Steins;Gate 0 explores an alternate worldline where Okabe abandons time travel. While attempting to forget past traumas and get his life back on track, he meets an AI that re-opens old wounds.','dubbed','White Fox','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_10788.jpeg','Apr 12, 2018',0),(158,'owari-no-seraph','Seraph of the End: Vampire Reign','Owari no Seraph',12,'https://animemoon.net/kitsuImages/cover_8736.jpg','Supernatural, Vampire, Military, Drama, Action','With the appearance of a mysterious virus that kills everyone above the age of 13, mankind becomes enslaved by previously hidden, power-hungry vampires who emerge in order to subjugate society with the promise of protecting the survivors, in exchange for donations of their blood.\r\nAmong these survivors are Yuuichirou and Mikaela Hyakuya, two young boys who are taken captive from an orphanage, along with other children whom they consider family. Discontent with being treated like livestock under the vampires&#39; cruel reign, Mikaela hatches a rebellious escape plan that is ultimately doomed to fail. The only survivor to come out on the other side is Yuuichirou, who is found by the Moon Demon Company, a military unit dedicated to exterminating the vampires in Japan.\r\nMany years later, now a member of the Japanese Imperial Demon Army, Yuuichirou is determined to take revenge on the creatures that slaughtered his family, but at what cost?Owari no Seraph is a post-apocalyptic supernatural shounen anime that follows a young man&#39;s search for retribution, all the while battling for friendship and loyalty against seemingly impossible odds.','subbed','Wit','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_8736.jpg','Apr 04, 2015',0),(159,'owari-no-seraph_dubbed','Seraph of the End: Vampire Reign','Owari no Seraph',12,'https://animemoon.net/kitsuImages/cover_8736.jpg','Supernatural, Vampire, Military, Drama, Action','With the appearance of a mysterious virus that kills everyone above the age of 13, mankind becomes enslaved by previously hidden, power-hungry vampires who emerge in order to subjugate society with the promise of protecting the survivors, in exchange for donations of their blood.\r\nAmong these survivors are Yuuichirou and Mikaela Hyakuya, two young boys who are taken captive from an orphanage, along with other children whom they consider family. Discontent with being treated like livestock under the vampires&#39; cruel reign, Mikaela hatches a rebellious escape plan that is ultimately doomed to fail. The only survivor to come out on the other side is Yuuichirou, who is found by the Moon Demon Company, a military unit dedicated to exterminating the vampires in Japan.\r\nMany years later, now a member of the Japanese Imperial Demon Army, Yuuichirou is determined to take revenge on the creatures that slaughtered his family, but at what cost?Owari no Seraph is a post-apocalyptic supernatural shounen anime that follows a young man&#39;s search for retribution, all the while battling for friendship and loyalty against seemingly impossible odds.','dubbed','Wit','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_8736.jpg','Apr 04, 2015',0),(160,'fairy-gone','Fairy Gone','Fairy Gone',12,'https://animemoon.net/kitsuImages/cover_42130.jpg','Action, Demons, Fantasy, Magic, Supernatural','The anime is set in a world where fairies possess and reside within animals, granting them special powers. By surgically removing and transplanting the organs of a possessed animal into a human, humans can partially summon the fairy and use it as a weapon. Eventually, such individuals were used for war, and were called &#34;Fairy Soldiers.&#34; After a long war, these soldiers lost their purpose, and had to reintegrate into society. From the government, to the mafia, and even becoming terrorists, each tread their own path.\r\n\r\nThe story begins nine years after the end of the war, and centers on the protagonist Maria. Maria is a fresh recruit of &#34;Dorothea,&#34; an organization dedicated to the investigation and suppression of fairy-related crimes and incidents. Even in peacetime, the government is still unstable after the war. Many criminals still have lingering wounds from the previous conflict, and there are terrorist groups bent on revenge. This is the story of Fairy Soldiers seeking their own justice in a chaotic postwar world.','subbed','P.A. Works','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42130.jpg','Apr 08, 2019',0),(161,'fairy-gone_dubbed','Fairy Gone','Fairy Gone',12,'https://animemoon.net/kitsuImages/cover_42130.jpg','Action, Demons, Fantasy, Magic, Supernatural','The anime is set in a world where fairies possess and reside within animals, granting them special powers. By surgically removing and transplanting the organs of a possessed animal into a human, humans can partially summon the fairy and use it as a weapon. Eventually, such individuals were used for war, and were called &#34;Fairy Soldiers.&#34; After a long war, these soldiers lost their purpose, and had to reintegrate into society. From the government, to the mafia, and even becoming terrorists, each tread their own path.\r\n\r\nThe story begins nine years after the end of the war, and centers on the protagonist Maria. Maria is a fresh recruit of &#34;Dorothea,&#34; an organization dedicated to the investigation and suppression of fairy-related crimes and incidents. Even in peacetime, the government is still unstable after the war. Many criminals still have lingering wounds from the previous conflict, and there are terrorist groups bent on revenge. This is the story of Fairy Soldiers seeking their own justice in a chaotic postwar world.','dubbed','P.A. Works','Finished','P