ls, Yuno and Asta are ready for the hardest of challenges to achieve their common dream: to be the Wizard King.','subbed','Pierrot','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_13209.jpg','Oct 03, 2017',0),(194,'black-clover-tv_dubbed','Black Clover','Black Clover',0,'https://animemoon.net/kitsuImages/cover_13209.jpg','Comedy, Magic, Fantasy, Action','In a world where magic is everything, Asta and Yuno are both found abandoned at a church on the same day. While Yuno is gifted with exceptional magical powers, Asta is the only one in this world without any. At the age of fifteen, both receive grimoires, magic books that amplify their holder&#39;s magic. Asta&#39;s is a rare Grimoire of Anti-Magic that negates and repels his opponent&#39;s spells. Being opposite but good rivals, Yuno and Asta are ready for the hardest of challenges to achieve their common dream: to be the Wizard King.','dubbed','Pierrot','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_13209.jpg','Oct 03, 2017',0),(195,'z-x-code-reunion','Z/X: Code Reunion','Z/X: Code Reunion',6,'https://animemoon.net/kitsuImages/cover_42307.jpg',' Sci-Fi, Fantasy, School, Shounen','The signing of a peace treaty has secured a tenuous ceasefire between mankind and the Zex, beings who emerged from space/time rifts connected to mysterious, distant worlds. Partnered with a Zex named Rigel, Azumi Kakamigahara must shoulder the fate of her own idyllic world.','subbed','Passione','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42307.jpg','Oct 08, 2019',0),(196,'kandagawa-jet-girls','Kandagawa Jet Girls','Kandagawa Jet Girls',3,'https://animemoon.net/kitsuImages/cover_42476.jpg','Sports','Jet-Racing has become a mega-popular extreme sport across the world, and with good reason! The Jetter pilots a high velocity watercraft and is paired with a Shooter who blasts rival teams with a hydro gun. It all adds up to explosive, wet-and-wild action as they race to the finish and compete to earn supremacy. Among those competing is Rin Namiki, and racing is in her blood. Rin aspires to become a legendary Jetter just like her mother, and after meeting the cool and gorgeous Shooter Misa Aoi, it looks like Rins dreams are finally in reach with a partner who shares her passion! Every race brings them tighter together as a team and closer than ever to their dream of becoming the best Jet Racers on the water.','subbed','TNK','Currently Airing','R-Partial nudity','https://animemoon.net/kitsuImages/banner_42476.png','Oct 08, 2019',0),(197,'hataage-kemono-michi_dubbed','Kemono Michi: Rise Up','Hataage! Kemono Michi',2,'https://animemoon.net/kitsuImages/cover_42127.jpg','Comedy, Fantasy, Shounen','The manga follows masked wrestler Genzou Shibata, who likes all kinds of animals and creatures. One day he is summoned to another world, where a princess asks him to help kill magical beasts, but he gets mad and puts her in a German suplex. Instead, he begins life as a pet shop owner in the other world.','dubbed','ENGI','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42127.jpg','Oct 02, 2019',0),(198,'blade-of-the-immortal','Blade of the Immortal','Mugen no Juunin',7,'https://animemoon.net/kitsuImages/cover_3490.jpg','Action, Adventure, Historical, Supernatural, Drama, Martial Arts, Samurai, Seinen','Manji is an immortal swordsman, who has been cursed with eternal life. He has grown tired of living with all the death he has created. He has no skills other than those of killing, thus he forms a plan to regain his mortality: he shall kill one hundred evil men for each good one he has killed. The old witch who afflicted Manji with immortality agrees to Manjis proposition and Manji is set on his path to kill one thousand evil men. On his journey he meets a young girl, Rin, who has her own vengeance to seek against the sword school whose members slaughtered Rins family. Rin and Manji journey together, each hoping to find some kind of peace. In their way are many varied enemies. Rin and Manji are almost constantly under attack and must learn to live their lives, avoiding being consumed by revenge.\n','subbed','LIDENFILMS','Finished','R-17+ (violence & profanity)','https://animemoon.net/kitsuImages/banner_3490.jpg','Oct 10, 2019',0),(199,'houkago-saikoro-club','After School Dice Club','Houkago Saikoro Club',6,'https://animemoon.net/kitsuImages/cover_42345.jpg','Game, Comedy, School, Shounen','A story about girls playing board games after school!\r\n\r\nKyoto in Spring. Aya is a high school girl who&#39;s just moved to a new town. Miki is her shy classmate, and her first friend. One day after school Aya and Miki follow the committee president Midori to a speciality board games store. The Dice Club!! Without thinking they try out a German board game together.','subbed','LIDENFILMS','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42345.jpg','Oct 03, 2019',0),(200,'watashi-nouryoku-wa-heikinchi-de-itta-yo-ne','Didnt I Say to Make My Abilities Average in the Next Life','Watashi, Nouryoku wa Heikinchi de tte Itta yo ne',7,'https://animemoon.net/kitsuImages/cover_42423.jpg','Comedy, Fantasy','When she turns ten years old, Adele von Ascham is hit with a horrible headacheand memories of her previous life as an eighteen-year-old Japanese girl named Kurihara Misato. That life changed abruptly, however, when Misato died trying to aid a little girl and met god. During that meeting, she made an odd request and asked for average abilities in her next life. But few thingsespecially wishesever go quite as planned.','subbed','Project No. 09','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42423.jpg','Oct 07, 2019',0),(201,'choujin-koukousei-tachi-wa-isekai-demo-yoyuu-de-ikinuku-you-desu','High School Prodigies Have It Easy Even in Another World!','Choujin Koukousei-tachi wa Isekai demo Yoyuu de Ikinuku you desu!',7,'https://animemoon.net/kitsuImages/cover_42222.jpg','Fantasy','Seven Japanese high school prodigies have taken the world by storm, exercising their mind-blowing abilities in everything from politics to entertainment. But when their plane crashes one day, these geniuses awaken to find themselves in a different realm-one that&#39;s home to magic and beast folk! While such strange new surroundings might throw an average person for a loop, these prodigies take their situation in stride...','subbed','Project No.9','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42222.jpg','Oct 03, 2019',0),(202,'no-guns-life_dubbed\r\n','No Guns Life','',0,'https://animemoon.net/img/anime/newicons/no_guns_life.jpg','Action, Sci-Fi, Seinen','Ex-soldier Juuzou Inui has one questionwho turned him into a cyborg and erased his memories?  After the war, cyborg soldiers known as the Extended were discharged. Juzo Inui is one of them, a man whose body was transformed, his head replaced with a giant gun! With no memory of his previous lifeor who replaced his head and whyInui now scratches out a living in the dark streets of the city as a Resolver, taking on cases involving the Extended.  When a fellow Extended showed up in Inui&#39;s officeon the run from the Security Bureau with a kidnapped child in tow and asking for helpInui should have just thrown the guy out. But Inui&#39;s loyalty to a brother Extended makes him take the job. Keeping the child safe won&#39;t be easy, since everyone seems to want to grab him, from street punks to the megacorporation Berhren, who have sent out a special agent that knows exactly how to deal with the Extended...','dubbed','Madhouse','Currently Airing','PG-13 - Teens 13 or older','https://animemoon.net/img/anime/newicons/1038623.jpg','Oct 11, 2019',0),(203,'hoshiai-no-sora','Stars Align','Hoshiai no Sora',6,'https://animemoon.net/kitsuImages/cover_42094.png',' Slice of Life, Sports, Drama, School',