d Order -First Order-','Fate/Grand Order: First Order',1,'https://animemoon.net/kitsuImages/cover_12710.png','Magic, Supernatural, Fantasy, Action','The Chaldea Security Organization was founded to focus on preserving the continuation of human history. They observe a world which magecraft couldnt observe, and science couldnt measure, all to prevent the certain extinction of humanity. But one day, the future that Chaldea continued to observe disappears and humanitys extinction in 2017 becomes clear. Based on the assumption that Fuyuki, a provincial town in Japan, is the reason for humanitys extinction, Chaldea issues an order to explore, investigate, and possibly destroy this singularity  a quest for the Holy Grail, the Grand Order.','subbed','Unknown','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_12710.jpg','Dec 31, 2016',0),(208,'fate-grand-order-first-order_dubbed','Fate-Grand Order -First Order-','Fate/Grand Order: First Order',1,'https://animemoon.net/kitsuImages/cover_12710.png','Magic, Supernatural, Fantasy, Action','The Chaldea Security Organization was founded to focus on preserving the continuation of human history. They observe a world which magecraft couldnt observe, and science couldnt measure, all to prevent the certain extinction of humanity. But one day, the future that Chaldea continued to observe disappears and humanitys extinction in 2017 becomes clear. Based on the assumption that Fuyuki, a provincial town in Japan, is the reason for humanitys extinction, Chaldea issues an order to explore, investigate, and possibly destroy this singularity  a quest for the Holy Grail, the Grand Order.','dubbed','Unknown','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_12710.jpg','Dec 31, 2016',0),(209,'rifle-is-beautiful','Chidori RSC','Rifle Is Beautiful',3,'https://animemoon.net/kitsuImages/cover_42292.jpg','Slice of Life, Comedy, School','Kokura Hikari is a first-year high school girl who loves rifle shooting. She entered Chidori High School because it had a shooting club, but finds that the club had been disbanded. She had only one day to find enough members to reform the club, but luckily was able to find three other first-year girls who she had met at a competition in middle school.\r\n\r\nThus begins the daily activities of the Chidori High Shooting Club.','subbed','Sentai Filmworks','Currently Airing','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_42292.jpg','Oct 13, 2019',0),(210,'roku-de-nashi-majutsu-koushi-to-kinki-kyouten','Akashic Records of Bastard Magic Instructor','Rokudenashi Majutsu Koushi to Akashic Records',12,'https://animemoon.net/kitsuImages/cover_11942.jpg','Magic, School, Fantasy, Action','Sistina attends a magical academy to hone her skills in the magical arts, hoping to solve the mystery of the enigmatic Sky Castle. After the retirement of her favorite teacher, the replacement, Glen, turns out to be a tardy, lazy, and seemingly incompetent bastard of an instructor.','subbed','LIDENFILMS','Finished','R-','https://animemoon.net/kitsuImages/banner_11942.png','Apr 04, 2017',0),(211,'roku-de-nashi-majutsu-koushi-to-kinki-kyouten_dubbed','Akashic Records of Bastard Magic Instructor','Rokudenashi Majutsu Koushi to Akashic Records',12,'https://animemoon.net/kitsuImages/cover_11942.jpg','Magic, School, Fantasy, Action','Sistina attends a magical academy to hone her skills in the magical arts, hoping to solve the mystery of the enigmatic Sky Castle. After the retirement of her favorite teacher, the replacement, Glen, turns out to be a tardy, lazy, and seemingly incompetent bastard of an instructor.','dubbed','LIDENFILMS','Finished','R-','https://animemoon.net/kitsuImages/banner_11942.png','Apr 04, 2017',0),(212,'bokutachi-wa-benkyou-ga-dekinai','We Never Learn: BOKUBEN','Bokutachi wa Benkyou ga Dekinai',13,'https://animemoon.net/kitsuImages/cover_41956.jpg','Comedy, Harem, Romance, School, Shounen','Nariyuki Yuiga is in his last and most painful year of high school. In order to gain the special VIP recommendation which would grant him a full scholarship to college, he must now tutor his classmates as they struggle to prepare for entrance exams.','subbed','Silver, Arvo Animation','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_41956.jpg','Apr 07, 2019',0),(213,'akagami-no-shirayuki-hime','Snow White with the Red Hair','Akagami no Shirayuki-hime',0,'https://animemoon.net/kitsuImages/cover_10621.jpg','Fantasy, Drama, Romance','Although her name means &#34;snow white,&#34; Shirayuki is a cheerful, red-haired girl living in the country of Tanbarun who works diligently as an apothecary at her herbal shop. Her life changes drastically when she is noticed by the silly prince of Tanbarun, Prince Raji, who then tries to force her to become his concubine. Unwilling to give up her freedom, Shirayuki cuts her long red hair and escapes into the forest, where she is rescued from Raji by Zen Wistalia, the second prince of a neighboring country, and his two aides. Hoping to repay her debt to the trio someday, Shirayuki sets her sights on pursuing a career as the court herbalist in Zen&#39;s country, Clarines.\r\n\r\nAkagami no Shirayuki-hime depicts Shirayuki&#39;s journey toward a new life at the royal palace of Clarines, as well as Zen&#39;s endeavor to become a prince worthy of his title. As loyal friendships are forged and deadly enemies formed, Shirayuki and Zen slowly learn to support each other as they walk their own paths.','subbed','Bones','Finished','PG-Teens 13 or older','https://animemoon.net/kitsuImages/banner_10621.png','Jul 07, 2015',0),(214,'akagami-no-shirayuki-hime_dubbed','Snow White with the Red Hair','Akagami no Shirayuki-hime',0,'https://animemoon.net/kitsuImages/cover_10621.jpg','Fantasy, Drama, Romance','Although her name means &#34;snow white,&#34; Shirayuki is a cheerful, red-haired girl living in the country of Tanbarun who works diligently as an apotheca